import React from 'react';

import { v4 as uuidv4 } from "uuid";
import { data } from './../data';

import ImgDisplayer from './ImgDisplayer';

export default function Gallery({ leng }) {

    return (
        <div className="gallery">
            data.projects.map(proj =>
            <ImgDisplayer
                key={uuidv4()}
                data={proj}
                leng={leng} />
            )
        </div>
    )
}
